    false,nt"url": null,nt"notes": "These data contain basic information describing
    well logs and compiled by the Arizona Geological Survey, published as a downloadable
    file, ESRI Service, and as a Web Feature service for the National Geothermal Data
    System . The downloadable documents contain 9 worksheets, including information
    about the template, notes related to revisions of the template, resource provider
    information, the data, a field list (data mapping view) and a worksheet with vocabularies
    for use in populating the spreadsheet (data valid terms). Data from 2,491 total
    well logs are included. Fields in the data table include Well Name, API Number,
    Ended Drilling Date, Well Type, Bottom Logged Interval,and Log Notes.nn",nt"license_title":
